import React from 'react';
import "./VideoCall.css";


function VideoCall({ status, friendId, startCall, rejectCall }) {
    const callWithVideo = (video) => {
        const config = { audio: true, video };
        return () => startCall(true, friendId, config);
    };

    return (
        <div class={`call ${status}`} id="call">
            <video id="call-local-video" autoPlay></video>
            <video id="call-remote-video" autoPlay></video>
            <div class="content">
                <div class="container">
                    <div class="inside">
                        <div class="panel">
                            <div class="participant">
                                <img class="avatar-call" src="https://res.cloudinary.com/dged6fqkf/image/upload/v1581173169/jbwkupd6wxap1udmgfmz.png" alt="avatar" />
                                <span>Connecting to Sarah</span>
                                <div class="wave">
                                    <span class="dot"></span>
                                    <span class="dot"></span>
                                    <span class="dot"></span>
                                </div>
                            </div>
                            <div class="options">
                                <button class="btn option"><i class="ti-microphone"></i></button>
                                <button class="btn option"><i class="ti-video-camera"></i></button>
                                <button class="btn option"><i class="ti-user">+</i></button>
                                <button class="btn option"><i class="ti-volume"></i></button>
                                <button class="btn option"><i class="ti-comment"></i></button>
                            </div>
                            <button id="end-call-video" class="btn option call-end"><i class="ti-close"></i></button>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default VideoCall;
